import logo from './logo.svg';
import './App.css';
import FinalPage from './component/FinalPage/FinalPage';

function App() {
  return (
      <main>
          <Switch>
              <Route path="/" component={FinalPage} exact />
          </Switch>
      </main>
  )
}

export default App;
